PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?cosmonaut ?label WHERE {
  ?cosmonaut wdt:P106 ?occupation ; wdt:P27 ?country .
  FILTER ( ?country = wd:Q15180 || ?country = wd:Q159 ) .
  FILTER ( ?occupation = wd:Q12634815 || ?occupation = wd:Q11631 ) .
  OPTIONAL {
    ?cosmonaut rdfs:label ?label .
    FILTER ( LANG( ?label ) = 'en' )
  }
}
LIMIT 10

