PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?capital ?population WHERE {
  wd:Q79 wdt:P36 ?capital .
  ?capital wdt:P1082 ?population .
  FILTER ( ?capital = wd:Q85 ) .
  OPTIONAL {
    ?otherCity wdt:P17 wd:Q79 ; wdt:P31 wd:Q515 ; wdt:P1082 ?otherPopulation .
    FILTER ( ?otherPopulation > ?population )
  }
  FILTER ( NOT EXISTS {
    ?otherCity wdt:P17 wd:Q79 ; wdt:P31 wd:Q515 ; wdt:P1082 ?otherPopulation .
    FILTER ( ?otherPopulation > ?population )
  }
  )
}

